import React, { Component } from 'react';
import Map from '../components/Map';
import StoreCard from '../organisms/StoreCard';
import './Main.scss';

class Main extends Component {
    constructor(prop){
        super(prop);
        this.state = {}
    }

    componentDidMount() {
        this._getStores();
    }

    _getStores = async () => {
        const stores = await this._callApi();
        this.setState({
            stores
        })
    };

    _callApi = () => {
        // Api 호출 Test Code
        return [{
            img_src:'data:image/jpeg;base64,',
            img_alt:'스타벅스 아주대점',
            name:'스타벅스 아주대점',
            address:'경기도 수원시 팔달구 우만2동 월드컵로 205',
            tel:'031-215-4516',
            description:'시애틀에 본사를 두고 있고 간단한 스낵과 무료 Wi-Fi를 제공하는 유명 커피 체인점입니다.',
            no:1,
        }, {
            img_src:'data:image/jpeg;base64,',
            img_alt:'탐앤탐스 수원아주대점',
            name:'탐앤탐스 수원아주대점',
            address:'경기도 수원시 영통구 원천동 아주로 46',
            tel:'031-211-3565',
            description:'24시 카페',
            no:2,
        }]
    };

    _renderCards = () => {
        return this.state.stores.map(store => {
            return <StoreCard 
                img_src={store.img_src}
                img_alt={store.img_alt}
                store_name={store.name}
                store_address={store.address}
                store_tel={store.tel}
                store_description={store.description}
                key={store.no}
            />
        });
    };

    render() {
        const stores = this.state.stores;
        return (
            <div className='main'>
                <section className='store-list'>
                    {stores ? this._renderCards() : ''}
                </section>
                <section className={stores ? 'with-stores' : ''}>
                    <Map />
                </section>
            </div>
        );
    }    
}

export default Main;